  true,\n\t\"url\": null,\n\t\"notes\": \"A bibliography is presented of papers reporting
  absolute measurements of photon (XUV, x-ray, gamma-ray, bremsstrahlung) total interaction
  cross sections or attenuation coefficients for the elements and some compounds.
  The energy range covered is from 10 eV to above 10 GeV. These papers are part of
  the reference collection of the National Institute of Standards and Technology Photon
  and Charged Particle Data Center. They cover the period from 1907 through 1995.
  Included with each reference are annotations specifying the energy range covered
  and the substances studied. This updated bibliography now includes 580 non-duplicative
  references to available measured data, plus 42 references to critical evaluations
  and review articles.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
